// components/HomePage.js
import React from 'react';
import ProductListingPage from './ProductListingPage';

const HomePage = () => {
    return (
        <div>
            <h1>Welcome to the Plant Shop</h1>
            <h2>Featured Plants</h2>
            <ProductListingPage />
        </div>
    );
};

export default HomePage;
